window.bookSummaryJSON = "<p>Gena Showalter puts a daring spin on a tale of huntress and hunted…and concocts a sensual chemistry that is positively explosive. </p> <p>Aleaha Love can be anyone - literally. With only skin-to-skin contact, she can change her appearance and assume any identity. Her newest identity switch has made her an AIR (Alien Investigation and Removal) agent and sends her on a mission to capture a group of otherworldly warriors. Only <i>she</i> becomes the captured. Breean, a golden-skinned commander known for his iron will who is at once dangerous and soul-shatteringly seductive, threatens her new life. Because for the first time, Aleaha only wants to be herself….</p>"; 
